import React, { useState } from 'react';
import { Bot, Clock, Droplets, CheckCircle, AlertCircle, Building2, User, ChevronLeft } from 'lucide-react';

const portfolioData = [
  {
    name: 'וילה קיסריה',
    rooms: [
      { id: 'K1', name: 'סוויטת ים', status: 'תפוס', cleaning: 'נקי', timeLeft: '00:45' },
      { id: 'K2', name: 'חדר גן', status: 'פנוי', cleaning: 'דרוש ניקיון', timeLeft: '-' },
      { id: 'K3', name: 'סטודיו VIP', status: 'בניקיון', cleaning: 'בתהליך', timeLeft: '-' },
    ]
  },
  {
    name: 'פנטהאוז תל אביב',
    rooms: [
      { id: 'T1', name: 'סוויטה ראשית', status: 'תפוס', cleaning: 'נקי', timeLeft: '01:20' },
      { id: 'T2', name: 'חדר אורבני', status: 'פנוי', cleaning: 'נקי', timeLeft: '-' },
    ]
  },
  {
    name: 'סוויטת ירושלים',
    rooms: [
      { id: 'J1', name: 'חדר אבן', status: 'תפוס', cleaning: 'נקי', timeLeft: '00:15' },
    ]
  }
];

function App() {
  const [selectedProp, setSelectedProp] = useState(null);

  return (
    <div style={{ padding: '30px', fontFamily: 'Inter, sans-serif', direction: 'rtl', backgroundColor: '#020617', color: '#f8fafc', minHeight: '100vh' }}>
      
      {/* Header יוקרתי */}
      <header style={{ marginBottom: '40px', borderBottom: '1px solid #1e293b', paddingBottom: '20px' }}>
        <h1 style={{ fontSize: '32px', fontWeight: '800', margin: '0' }}>LuxuryStay <span style={{ color: '#3b82f6' }}>Command Center</span></h1>
        <p style={{ color: '#64748b', marginTop: '10px' }}>מרכז שליטה רב-נכסי - ניטור חדרים לפי שעה בזמן אמת</p>
      </header>

      {/* תצוגת נכסים */}
      <div style={{ display: 'flex', flexDirection: 'column', gap: '40px' }}>
        {portfolioData.map((property) => (
          <div key={property.name} style={{ background: '#0f172a', borderRadius: '24px', padding: '25px', border: '1px solid #1e293b' }}>
            <div style={{ display: 'flex', alignItems: 'center', gap: '12px', marginBottom: '25px' }}>
              <div style={{ background: 'rgba(59, 130, 246, 0.1)', padding: '10px', borderRadius: '12px' }}><Building2 color="#3b82f6" /></div>
              <h2 style={{ fontSize: '22px', margin: 0 }}>{property.name}</h2>
              <span style={{ fontSize: '14px', color: '#64748b', marginRight: 'auto' }}>{property.rooms.length} חדרים פעילים</span>
            </div>

            {/* Grid חדרים בתוך הנכס */}
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))', gap: '20px' }}>
              {property.rooms.map((room) => (
                <div key={room.id} style={{ background: '#020617', padding: '20px', borderRadius: '18px', border: '1px solid #1e293b' }}>
                  <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '15px' }}>
                    <span style={{ fontWeight: '700' }}>{room.name}</span>
                    <span style={{ fontSize: '11px', color: '#475569' }}>{room.id}</span>
                  </div>

                  <div style={{ display: 'flex', alignItems: 'center', gap: '10px', marginBottom: '12px' }}>
                    <div style={{ width: '8px', height: '8px', borderRadius: '50%', backgroundColor: room.status === 'תפוס' ? '#ef4444' : '#22c55e' }}></div>
                    <span style={{ fontSize: '14px' }}>{room.status}</span>
                    {room.status === 'תפוס' && <span style={{ fontSize: '12px', color: '#94a3b8', marginRight: 'auto' }}><Clock size={12} style={{verticalAlign: 'middle', marginLeft: '4px'}}/>{room.timeLeft}</span>}
                  </div>

                  <div style={{ display: 'flex', alignItems: 'center', gap: '10px', background: 'rgba(255,255,255,0.02)', padding: '10px', borderRadius: '10px' }}>
                    <Droplets size={14} color={room.cleaning === 'דרוש ניקיון' ? '#fbbf24' : '#3b82f6'} />
                    <span style={{ fontSize: '13px', color: room.cleaning === 'דרוש ניקיון' ? '#fbbf24' : '#f8fafc' }}>{room.cleaning}</span>
                    {room.cleaning === 'דרוש ניקיון' && (
                       <button style={{ marginRight: 'auto', background: '#3b82f6', border: 'none', color: '#fff', fontSize: '11px', padding: '4px 8px', borderRadius: '6px', cursor: 'pointer' }}>
                         הקפץ מנקה
                       </button>
                    )}
                  </div>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>

      {/* AI Assistant Floating Bar */}
      <div style={{ position: 'fixed', bottom: '30px', left: '30px', right: '30px', background: 'rgba(15, 23, 42, 0.9)', backdropFilter: 'blur(10px)', border: '1px solid #3b82f6', padding: '20px', borderRadius: '24px', display: 'flex', alignItems: 'center', gap: '20px', boxShadow: '0 -10px 40px rgba(0,0,0,0.5)' }}>
        <Bot color="#3b82f6" size={30} />
        <div style={{ flex: 1, color: '#94a3b8', fontSize: '15px' }}>
          <strong>AI Insights:</strong> כרגע יש 2 חדרים שממתינים לניקיון מעל 15 דקות. האם תרצה שאשלח תזכורת לצוות?
        </div>
        <button style={{ background: '#3b82f6', color: '#fff', border: 'none', padding: '10px 25px', borderRadius: '12px', fontWeight: '600', cursor: 'pointer' }}>בצע אופטימיזציה</button>
      </div>
    </div>
  );
}

export default App;
